script: |
  super -f tsv -I q3289.sql | sort > q3289.out

vector: true

inputs:
  - name: q3289.sql
    data: |
      SELECT MIN ( DISTINCT - 32 ) AS col2, CAST ( - COUNT ( * ) AS INTEGER ) FROM tab1 AS cor0 CROSS JOIN tab0 AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q3289.out
    data: |
      -32	-9
